import React from 'react'
import { Button, Card, Table } from 'antd';
import { PlusCircleOutlined } from '@ant-design/icons'

export default function Goniometria({ goniometria }) {

    const columns = [
        {
            title: 'articulacion',
            dataIndex: 'articulacion',
            key: 'articulacion',
        },
        {
            title: 'movimiento',
            dataIndex: 'movimiento',
            key: 'movimiento',
        },
        {
            title: 'completa',
            dataIndex: 'completa',
            key: 'completa',
        },
        {
            title: 'ayuda',
            dataIndex: 'ayuda',
            key: 'ayuda',
        },
        {
            title: 'dolor',
            dataIndex: 'dolor',
            key: 'dolor',
        },
        {
            title: 'grados',
            dataIndex: 'grados',
            key: 'grados',
        },
    ];


    return <div>
        <Table dataSource={goniometria} columns={columns} size='small' bordered pagination={false} title={() => 'Rangos de movimiento/goniometria'} />
        <Button> <PlusCircleOutlined /> </Button>
    </div>

}
